// App.js
import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { countUp, countDown } from './slice';

function App() {
  const count = useSelector((state) => state.counter.count); // 状態を取得
  const dispatch = useDispatch(); // アクションをディスパッチ

  return (
    <div>
      <h1>count: {count}</h1>
      <input type="number" />
      <button onClick={() => dispatch(countUp())}>+</button>
      <button onClick={() => dispatch(countDown())}>-</button>
      
    </div>
  );
}

export default App;
